DROP DATABASE IF EXISTS pedigree_visualizer;
CREATE DATABASE pedigree_visualizer;

USE pedigree_visualizer;

DROP TABLE IF EXISTS swine;

CREATE TABLE swine
	(
	registration_number INT NOT NULL,
	farm_name VARCHAR(30) NOT NULL,
	swine_breed VARCHAR(30) NOT NULL,
	swine_sex VARCHAR(8) NOT NULL,
	birthyear INT(4) NOT NULL,
	weight_at_data_collection INT(4) NOT NULL,
	age_at_data_collection INT(4) NOT NULL,
	date_registered DATE,
	registered_by VARCHAR(30) NOT NULL,
	standardized_ave_daily_gain INT(4) NOT NULL,
	actual_ave_daily_gain INT(4) NOT NULL,
	standardized_backfat_thickness INT(4) NOT NULL,
	actual_backfat_thickness INT(4) NOT NULL,
	standardized_feed_efficiency INT(4) NOT NULL,
	actual_feed_efficiency INT(4) NOT NULL,
	birth_weight INT(4) NOT NULL,
	total_when_born_male INT(4) NOT NULL,
	total_when_born_female INT(4) NOT NULL,
	standardized_total_when_born INT(4) NOT NULL,
	actual_littersize_born_alive INT(4) NOT NULL,
	standardized_littersize_born_alive INT(4) NOT NULL,
	parity INT(4) NOT NULL,
	standardized_littersize_at_weaning INT(4) NOT NULL,
	actual_littersize_at_weaning INT(4) NOT NULL,
	litterweight_at_weaning INT(4) NOT NULL,
	maternal INT NOT NULL,
	paternal INT NOT NULL,
	PRIMARY KEY (registration_number)
	);

